import styled from 'styled-components';

const RecipeFilterStyled = styled.div`
	text-align: center;
`;

function RecipeFilter() {
	return (
		<RecipeFilterStyled>
			<Form>
				<input></input>
			</Form>
		</RecipeFilterStyled>
	);
}

export default RecipeFilter;
